pub fn get_teradata_root_grammar_id() -> GrammarId {
    GrammarId(1322)
}
pub fn get_teradata_root_grammar_table() -> RootGrammar {
    RootGrammar {
        grammar_id: get_teradata_root_grammar_id(),
        tables: &TERADATA_TABLES,
    }
}
pub fn get_teradata_root_grammar() -> RootGrammar {
    get_teradata_root_grammar_table()
}
